import React from 'react';
import { TxtStyleProvider } from './TxtStyleContext'; // Adjust the import path
import Content from './Content';

const Home = () => {
  return (
    <TxtStyleProvider>
      <>
        <h1>This is Sparta!!</h1>
        <Content />
      </>
    </TxtStyleProvider>
  );
}

export default Home;
